// 패션인트로 데이터 JS 

export const fsData = {
    men:{
        isrc:"./images/men02.png",
        ialt:"공유다!",
        tit:["MEN'S","ESSENTIALS"]
    },
    women:{
        isrc:"./images/women01.png",
        ialt:"여자",
        tit:["WOMEN'S","ESSENTIALS"]
    },
    // 스타일 데이터는 배열로 2개를 사용함!
    style:{
        isrc:["./images/style02.png","./images/style03.png"],
        ialt:["여자스타일","공유스타일"],
        tit:[["MEN'S","STYLE"],["WOMEN'S","STYLE"]]
    },
}; //////////// fsData ////////////
